import React from 'react'
import { DragDropContext } from 'react-beautiful-dnd'

function PanelElement({children}) {
    
  const onDragEnd = () =>{
      console.log("test")
  }

  return (
    <DragDropContext onDragEnd={onDragEnd}>
    <div className='panel'>
        <div className="boxSelector"></div>
        {children}
    </div>
    </DragDropContext>
  )
}

export default PanelElement
